/* ONE light UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
html {
  font-size: 11px;
}
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.list-group,
.list-group .list-group-item {
  background-color: transparent;
  border: none;
  padding: 0;
  margin: 0;
  position: static;
}
.list-group,
.list-tree {
  margin: 0;
  padding: 0;
  list-style: none;
  cursor: default;
}
.list-group li:not(.list-nested-item),
.list-tree li:not(.list-nested-item),
.list-group li.list-nested-item > .list-item,
.list-tree li.list-nested-item > .list-item {
  line-height: 2em;
  text-wrap: none;
  white-space: nowrap;
}
.list-group .selected::before,
.list-tree .selected::before {
  content: '';
  background-color: rgba(140, 115, 115, 0.18);
  position: absolute;
  left: 0;
  right: 0;
  height: 2em;
}
.list-group .selected > *,
.list-tree .selected > * {
  position: relative;
}
.list-group .icon::before,
.list-tree .icon::before {
  margin-right: 0.45454545em;
  position: relative;
  top: 1px;
}
.list-group .no-icon,
.list-tree .no-icon {
  padding-left: 16.45454545em;
}
.list-tree .list-nested-item > .list-tree > li,
.list-tree .list-nested-item > .list-group > li {
  padding-left: 16.45454545px;
}
.list-tree.has-collapsable-children li.list-item {
  margin-left: 1.45454545em;
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-group,
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-tree {
  display: none;
}
.list-tree.has-collapsable-children .list-nested-item > .list-item::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 1em;
  width: 1em;
  height: 1em;
  content: "\f0a3";
}
.list-tree.has-collapsable-children .list-nested-item > .list-item::before {
  position: relative;
  top: -1px;
  margin-right: 0.45454545em;
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 1em;
  width: 1em;
  height: 1em;
  content: "\f078";
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item::before {
  left: 1px;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li {
  padding-left: 1.45454545em;
}
.list-tree.has-collapsable-children .has-flat-children li.list-item,
.list-tree.has-collapsable-children.has-flat-children li.list-item {
  margin-left: 0;
}
